/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props.movies);
  }

  render() {
    return (
      <div>
        {this.props.movies.map(function(movie, index) {
          return <p>{movie.props.movies[0].popularity}</p>;
        })}
      </div>
    );
  }
}

export default MovieList;
